EMPTY_STRING=
JMS_CONTEXT_FACTORY_WSO2_BROKER=org.wso2.andes.jndi.PropertiesFileInitialContextFactory
JMS_PROVIDER_URL_WSO2_BROKER=/conf/jndi.properties
JMS_CONNECTION_FACTORY_WSO2_BROKER=QueueConnectionFactory
JMS_CONTEXT_FACTORY_ACTIVEMQ=org.apache.activemq.jndi.ActiveMQInitialContextFactory
JMS_PROVIDER_URL_ACTIVEMQ=tcp://localhost:61616
JMS_CONNECTION_FACTORY_ACTIVEMQ=QueueConnectionFactory
JDBC_DRIVER_MYSQL=com.mysql.jdbc.Driver
JDBC_DRIVER_ORACLE=oracle.jdbc.OracleDriver
JDBC_DRIVER_MSSQL=com.microsoft.sqlserver.jdbc.SQLServerDriver
